    This shoreline mapping effort also supports the National Spatial Reference System
    - the framework for latitude, longitude, height, scale, gravity, orientation, and
    shoreline throughout the United States. This data is primarily used to support the
    production of the NOAA Office of Coast Survey's Electronic Navigational Charts (ENC),
